export default function Topnav() {
    const topnav_items = ['Home', 'Portfolio', 'Contact'];
    let topnav_list = [];
    topnav_items.forEach(item => {
        topnav_items.push(<li className="nav-item">
            <a className={`nav-link ${(this.props.currentPage == item) ? 'active' : ''}`} href="index">
                {item}
            </a>
        </li>)
    })
    return (
        <nav className="navbar navbar-light navbar-expand-md navigation-clean">
            <div className="container">
                <a className="navbar-brand" href='#'>CalebHalter.me</a>
                <button data-toggle="collapse" className="navbar-toggler" data-target="#navcol-1">
                    <span className="sr-only">Toggle navigation</span>
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navcol-1">
                    <ul className="navbar-nav ml-auto">
                        <li className="nav-item"><a className="nav-link" href="index">Home</a></li>
                        <li className="nav-item"><a className="nav-link active" href="portfolio">Portfolio</a></li>
                        <li className="nav-item"><a className="nav-link" href="#">Contact</a></li>
                    </ul>
                </div>
            </div>
        </nav>
    )
}
